+@use "../utils/mixins" as *;
+
+.phone {
+  display: flex;
+  flex-direction: column;
+  gap: 8px;
+  text-align: right;
+  cursor: pointer;
+
+  &__label {
+    font-family: Cinzel, sans-serif;
